```solidity
pragma solidity 0.6.12;

contract SampleContract {
    string public name;
    uint8 public decimals;
    string public symbol;
    address public _owner;
    address public _dev;
    address public _devfeesaddr;
    uint256 public _tokepereth;
    bool private paused1;
    bool private paused;
    bool public _receiveeth;
    bool public _coldstorage;
    uint256 private price;
    uint256 public lifeval;
    uint256 private totalSupply1;
    uint256 private totalSupply;
    uint256 public _totalsupply;
    uint256 public _frozentokens;
    mapping(address => uint256) public balanceof;
    mapping(address => bool) public exchangepartners;
    mapping(address => uint256) public contractexchangerate;

    constructor() public payable {
        _owner = msg.sender;
        _totalsupply = 0x152d02c7e14af6800000;
        _tokepereth = 0x274d48fed3e8000;
        _dev = 0xC96CfB18C39DC02FBa229B6EA698b1AD5576DF4c;
        _devfeesaddr = 0x76D05E325973D7693Bb854ED258431aC7DBBeDc3;
        _receiveeth = true;
        _coldstorage = true;
        name = "SampleToken";
        symbol = "ST";
        decimals = 18;
    }

    function changeDevFeesAddr(address _newDevFeesAddr) public {
        require(msg.sender == _dev, "Only dev can update this");
        _devfeesaddr = _newDevFeesAddr;
    }

    function withdrawDevFees() public {
        require(msg.sender == _dev && paused1, "Only dev can withdraw and paused1 should be true");
        _devfeesaddr.transfer(totalSupply);
        totalSupply = 0;
    }

    function addExchangePartnerTargetAddress(address _partnerAddress) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only owner or dev can add partner");
        exchangepartners[_partnerAddress] = true;
    }

    function addExchangePartnerAddressAndRate(address _partnerAddress, uint256 _rate) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only owner or dev can add partner rate");
        contractexchangerate[_partnerAddress] = _rate;
    }

    fallback() external payable {
        require(_receiveeth, "Contract should be able to receive ether");
        require(msg.value > 0, "Value should be more than 0");
        uint256 amount = msg.value / 0xde0b6b3a7640000 * _tokepereth;
        require(_totalsupply >= amount, "Not enough tokens in the supply");
        _totalsupply -= amount;
        balanceof[msg.sender] += amount;
    }

    function exchange(address _exchangeContract, uint256 _tokens) public {
        require(balanceof[msg.sender] >= _tokens, "Not enough balance");
        _exchangeContract.call(abi.encodeWithSignature("exchangeTokensFromOtherContract(address,address,uint256)", address(this), msg.sender, _tokens));
        _totalsupply += _tokens;
        balanceof[msg.sender] -= _tokens;
    }

    function toggleReceiveEth() public {
        require(msg.sender == _dev, "Only dev can update this");
        _receiveeth = !_receiveeth;
    }

    function defrostFrozenTokens() public {
        require(msg.sender == _dev, "Only dev can defrost");
        _totalsupply += _frozentokens;
        _frozentokens = 0;
    }

    function exchangeTokensFromOtherContract(address _token, address _to, uint256 _amount) public {
        require(exchangepartners[msg.sender], "Not a valid exchange partner");
        require(balanceof[_to] + _amount * contractexchangerate[msg.sender] > balanceof[_to], "Overflow error");
        balanceof[_to] += _amount * contractexchangerate[msg.sender];
        _totalsupply -= _amount * contractexchangerate[msg.sender];
    }

    function changeDev(address _newDev) public {
        require(msg.sender == _dev, "Only dev can update this");
        _dev = _newDev;
    }

    function updateTokenBalance(uint256 _newBalance) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only owner or dev can update token balance");
        _totalsupply = _newBalance;
    }

    function changeOwner(address _newOwner) public {
        require(msg.sender == _owner, "Only owner can update this");
        _owner = _newOwner;
    }

    function updateFeeAmount(uint256 _newFee) public {
        require(_newFee >= 0 && _newFee <= 100, "Fee should be between 0 and 100");
        require(msg.sender == _dev || msg.sender == _owner, "Only owner or dev can update fee amount");
        price = _newFee * 100;
    }

    function removeExchangePartnerTargetAddress(address _partnerAddress) public {
        require(msg.sender == _dev || msg.sender == _owner, "Only owner or dev can remove partner");
        exchangepartners[_partnerAddress] = false;
    }

    function safeWithdrawal(address _recipient, uint256 _amount) public {
        require(msg.sender == _owner, "Only owner can withdraw");
        require(address(this).balance >= _amount * 0xde0b6b3a7640000, "Not enough balance in contract");
        _recipient.transfer(_amount * 0xde0b6b3a7640000);
    }

    function changePayRate(uint256 _newRate) public {
        require(_newRate >= 0, "Rate should be positive");
        require(msg.sender == _owner || msg.sender == _dev, "Only owner or dev can update pay rate");
        _tokepereth = _newRate;
    }

    function toggleFreezeTokensFlag() public {
        require(msg.sender == _dev, "Only dev can update this");
        _coldstorage = !_coldstorage;
    }

    function payFeesToggle() public {
        require(msg.sender == _dev, "Only dev can update this");
        paused1 = !paused1;
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value, "Not enough balance");
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }
}
```

